import logo from './logo.svg';
import './App.css';
import ReactAudioPlayer from 'react-audio-player';

const albumCover1 = require('./assets/albumCover/GalaxyExpress.png');
const trackOne = require('./assets/Albums/Galaxy Express/Emeraldes.wav');

function App() {
  return (
    <div className="container">
      <h1>Galaxy Express</h1>
      <h2>Released : 2020</h2>
      <img src={albumCover1} alt="Album Cover" heigh="300px" width="300px" />
      <p>
        This is the absolute perfect project to smoke to on a sunny afternoon or super late at night in the dark while your alone. Pretty chords , dope as fuck sounds , sick mystical sounding melodies and heavy 808's. These are some of my most beautiful beats. Have fun.
      </p>
      <div>
        <p>Emeraldes</p>
      <ReactAudioPlayer
        src={trackOne}
        autoPlay
        controls
      /> 
      </div>
    </div>
  );
}

export default App;
